def get_throttling_function_name(js: str) -> str:
    """Extract the name of the function that computes the throttling parameter.
    Args:
        js (str): The contents of the base.js asset file.
    Returns:
        str: The name of the function used to compute the throttling parameter.
    """
    function_patterns = [
        # Extrae el nombre de la funci√≥n de throttling
        r'a\.[a-zA-Z]\s*&&\s*\([a-z]\s*=\s*a\.get\("n"\)\)\s*&&\s*\([a-z]\s*=\s*([a-zA-Z0-9$]{2,3})(\[\d+\])?\([a-z]\)',
    ]
    for pattern in function_patterns:
        regex = re.compile(pattern)
        function_match = regex.search(js)
        if function_match:
            return function_match.group(1) 